import React from "react";
// import styles from "../modules/Emojis.module.css";

export default function Emojis() {
  return (
    <div className={styles.container}>
      <div className={styles.tittle}>
        <h2>Emojis</h2>
      </div>
      <div className={styles.categoryItem}>
        <h3>Top Picks</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Two Letter</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Three Letter</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Emojis</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Names</h3>
      </div>
    </div>
  );
}
